        body { font-family: 'Arial', sans-serif; font-size: 16px; }

        /* Test-specific CSS */
        .container {
            width: 400px;
            height: 300px;
            border: 2px solid #333;
            padding: 10px;
            overflow: auto;
        }
        table {
            width: 100%;
            border-collapse: collapse;
        }
        th, td {
            padding: 8px;
            text-align: center;
            font-size: 12px;
            border: 1px solid #666;
            vertical-align: middle;
        }
        th {
            background-color: #e0e0e0;
            font-weight: bold;
        }
